import React, { Component } from 'react';
import './App.css';
import Users from "./Users/Users";
import Todos from "./Todos/Todos";
import Posts from "./Posts/Posts";


class App extends Component {
    render() {
        return (
                <div className="App">
                    <Users/>
                    <Todos/>
                    <Posts/>
                </div>
        );
    }
}

export default App;
